void loop(int16_t data[], uint8_t array_size)
{
	startPWM();
	for(int i = 0; i < array_size; i++)
	{
		if(i%2==0)
		{
			startPWM();
			if(i == 0)
			{
				while(interrupt_count < data[i]/2);
				pausePWM();
			}
			else
			{
				while(interrupt_count != (abs(data[i]-data[i-1]))/2);
				pausePWM();
			}
		}
		else
		{
			while(interrupt_count != abs(data[i]-data[i-1]));
		}
	}
	dropPWM();
}

void startPWM()
{
	DDRD |= (1 << PWM_PIN);
	TCCR0A |= (1<<COM0B1);
	TCNT0 = 0;
	interrupt_count = 0;
}


void pausePWM()
{
	DDRD &= ~(1 << PWM_PIN);
	interrupt_count = 0;
}

void dropPWM()
{
	TCCR0A &= ~(1<<COM0B1);
}



